import React, { useState, useEffect } from "react";
import { BrowserRouter as Router, Routes, Route, Link, Navigate } from "react-router-dom";
import PeopleManagement from "./pages/PeopleManagement";
import AssetManagement from "./pages/AssetManagement";
import InventoryRecords from "./pages/InventoryRecords";
import Reports from "./pages/Reports";
import Settings from "./pages/Settings";
import Login from "./pages/Login";

const AppContent = () => {
  const [isAuthenticated, setIsAuthenticated] = useState(!!localStorage.getItem("access_token"));

  const handleLogout = () => {
    localStorage.removeItem("access_token");
    localStorage.removeItem("refresh_token");
    localStorage.removeItem("user");
    setIsAuthenticated(false);
  };

  return (
    <div style={{ padding: "20px" }}>
      {isAuthenticated && (
        <nav style={{ marginBottom: "20px" }}>
          <Link to="/">üè† È¶ñÈ†Å</Link> |{" "}
          <Link to="/people">üë• ‰∫∫Âì°ÁÆ°ÁêÜ</Link> |{" "}
          <Link to="/assets">üíº Ë≥áÁî¢ÁÆ°ÁêÜ</Link> |{" "}
          <Link to="/inventory">üì¶ Âá∫ÂÖ•Â∫´Á¥ÄÈåÑ</Link> |{" "}
          <Link to="/reports">üìä Â†±Ë°®</Link> |{" "}
          <Link to="/settings">‚öôÔ∏è Á≥ªÁµ±Ë®≠ÂÆö</Link> |{" "}
          <button onClick={handleLogout} style={{ marginLeft: "10px" }}>
            ÁôªÂá∫
          </button>
        </nav>
      )}

      <Routes>
        <Route path="/" element={isAuthenticated ? <h1>Ë≥áÁî¢ÁÆ°ÁêÜÁ≥ªÁµ±È¶ñÈ†Å</h1> : <Navigate to="/login" />} />
        <Route path="/people" element={isAuthenticated ? <PeopleManagement /> : <Navigate to="/login" />} />
        <Route path="/assets" element={isAuthenticated ? <AssetManagement /> : <Navigate to="/login" />} />
        <Route path="/inventory" element={isAuthenticated ? <InventoryRecords /> : <Navigate to="/login" />} />
        <Route path="/reports" element={isAuthenticated ? <Reports /> : <Navigate to="/login" />} />
        <Route path="/settings" element={isAuthenticated ? <Settings /> : <Navigate to="/login" />} />
        <Route path="/login" element={<Login onLogin={() => setIsAuthenticated(true)} />} />
      </Routes>
    </div>
  );
};

// ÊúÄÂ§ñÂ±§ÂåÖ Router
const App = () => (
  <Router>
    <AppContent />
  </Router>
);

export default App;
